import { useTranslation } from "react-i18next";
import { useEffect, useState } from "react";
import i18n from "./i18n";
import { Link, Route, Routes } from "react-router-dom";

function CategoryPage({ title }) {
  const images = Array.from({ length: 70 }, (_, i) => `/${title.toLowerCase().replace(/ /g, "")}/${i + 1}.jpg`);
  const [fullscreenIndex, setFullscreenIndex] = useState(null);
  const [filter, setFilter] = useState("");

  const handleNext = () => setFullscreenIndex((prev) => (prev + 1) % images.length);
  const handlePrev = () => setFullscreenIndex((prev) => (prev - 1 + images.length) % images.length);

  const filteredImages = images.filter((src) => src.toLowerCase().includes(filter.toLowerCase()));

  return (
    <div className="min-h-screen bg-floral bg-opacity-90 p-6 md:p-10 font-sans text-muted text-base">
      <h2 className="text-3xl font-bold text-leaf mb-4 animate-fade-in">{title}</h2>
      <p className="text-muted mb-6 animate-fade-in">Ta kontakt for spesialbestillinger eller sp√∏rsm√•l.</p>

      <input
        type="text"
        placeholder="S√∏k etter bilde..."
        value={filter}
        onChange={(e) => setFilter(e.target.value)}
        className="mb-6 p-2 border border-gray-300 rounded w-full max-w-sm animate-fade-in"
      />

      <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 lg:grid-cols-5 gap-6">
        {filteredImages.map((src, idx) => (
          <div key={idx} className="flex flex-col items-center bg-white rounded-xl overflow-hidden shadow hover:shadow-xl transition duration-300 animate-fade-in">
            <div className="w-[48px] h-[48px] sm:w-[64px] sm:h-[64px] md:w-[96px] md:h-[96px] overflow-hidden rounded shadow">
              <img
                src={src}
                alt={`${title} ${idx + 1}`}
                className="w-full h-full object-cover cursor-pointer transition-transform duration-300 hover:scale-105"
                onClick={() => setFullscreenIndex(images.indexOf(src))}
                onError={(e) => (e.target.style.display = "none")}
              />
            </div>
            <div className="text-center w-full mt-2">
              <span className="text-xs text-muted font-medium">{`${title} ${images.indexOf(src) + 1}`}</span>
            </div>
          </div>
        ))}
      </div>

      {fullscreenIndex !== null && (
        <div className="fixed inset-0 bg-black bg-opacity-90 flex flex-col items-center justify-center z-50 animate-zoom-in px-4">
          <button className="absolute top-5 right-5 text-white text-3xl hover:text-rose transition" onClick={() => setFullscreenIndex(null)}>
            ‚úï
          </button>
          <img
            src={images[fullscreenIndex]}
            alt="Fullscreen"
            className="max-w-full max-h-[85vh] rounded shadow-lg mb-4"
          />
          <div className="text-white text-lg italic font-light mb-4">{`${title} ${fullscreenIndex + 1}`}</div>
          <div className="flex gap-6">
            <button onClick={handlePrev} className="bg-white text-black px-4 py-2 rounded shadow hover:bg-gray-200">‚Üê Forrige</button>
            <button onClick={handleNext} className="bg-white text-black px-4 py-2 rounded shadow hover:bg-gray-200">Neste ‚Üí</button>
          </div>
        </div>
      )}

      <div className="mt-8 text-center animate-fade-in">
        <p className="text-lg text-muted">üìû Kontakt: 123 45 678 | ‚úâÔ∏è E-post: aranka@example.com</p>
      </div>
    </div>
  );
}

export default function HomePage() {
  const { t } = useTranslation();

  useEffect(() => {
    document.title = "Aranka Orsos Evighetsblomster";
  }, []);

  const changeLanguage = (lang) => i18n.changeLanguage(lang);

  const categories = [
    "Begravelse",
    "Bestselge",
    "Bryllups buketter",
    "Bursdags buketter",
    "Dekorasjoner",
    "Rosebuketter",
  ];

  return (
    <>
      <main
        className="min-h-screen font-sans text-muted text-base relative"
        style={{
          backgroundImage: "url('/leaf-bg.png.png')",
          backgroundSize: "cover",
          backgroundRepeat: "no-repeat",
          backgroundAttachment: "fixed",
        }}
      >
        <div className="absolute inset-0 bg-white bg-opacity-60 z-0"></div>

        <nav className="flex flex-wrap justify-between items-center p-4 bg-white bg-opacity-95 shadow-md sticky top-0 z-10">
          <div className="flex items-center space-x-4">
            <img src="/26.jpg" alt="Logo" className="w-[250px] max-w-[400px] h-auto rounded shadow animate-fade-in" />
            <span className="text-2xl font-bold text-leaf">Aranka Orsos</span>
          </div>
          <ul className="flex flex-wrap space-x-4 text-base text-leaf">
            {categories.map((cat) => (
              <li key={cat} className="hover:text-rose transition cursor-pointer">
                <Link to={`/${cat.toLowerCase().replace(/ /g, "-")}`}>{t(cat)}</Link>
              </li>
            ))}
          </ul>
          <select
            onChange={(e) => changeLanguage(e.target.value)}
            className="border p-2 rounded text-sm bg-white"
          >
            <option value="no">Norsk</option>
            <option value="en">English</option>
            <option value="lt">Lietuvi≈≥</option>
            <option value="sk">Slovensk√Ω</option>
            <option value="hu">Magyar</option>
            <option value="uk">–£–∫—Ä–∞—ó–Ω—Å—å–∫–∞</option>
          </select>
        </nav>

        <section className="py-12 px-6 md:px-20 text-center bg-white bg-opacity-90 rounded-xl mx-4 mt-6 shadow-lg z-10 relative animate-fade-in">
          <h1 className="text-[36px] font-extrabold mb-6 text-leaf">üá≥üá¥ NORSK</h1>
          <p className="text-lg text-muted mb-4">
            Skreddersydde blomsterarrangementer for alle anledninger ‚Äì silke, kunstige og friske blomster
          </p>
          <p className="text-base text-muted mb-2">
            For begravelse, d√•p, bursdag eller andre spesielle √∏yeblikk ‚Äì jeg lager vakre og personlige dekorasjoner med varme og omtanke.
          </p>
          <ul className="text-left text-muted mx-auto max-w-2xl list-disc list-inside my-4">
            <li>üå∏ Dekorasjoner med silke- og kunstblomster av h√∏y kvalitet</li>
            <li>üåº Friske blomsterbuketter p√• foresp√∏rsel</li>
            <li>üåπ Unike design i alle stiler og st√∏rrelser</li>
            <li>üåø H√•ndlaget blomsterkunst som varer</li>
          </ul>
          <p className="text-base text-muted mt-6">
            üõçÔ∏è Alle blomster og materialer bestilles fra p√•litelige norske leverand√∏rer: <strong>Interflora</strong> og <strong>Rusta</strong>.
          </p>
          <p className="text-xl font-semibold text-leaf mt-4">
